-- ----------------------------
-- Procedure structure for proc_ams_box
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_ams_box`;
DELIMITER ;;
CREATE DEFINER=`mysql`@`%` PROCEDURE `proc_ams_box`()
BEGIN
		DECLARE n int;
    DECLARE v_code varchar(2000);
    DECLARE v_name varchar(2000);
		DECLARE v_id varchar(2000);
		DECLARE v_id999999 varchar(2000);
		DECLARE v_id000001 varchar(2000);
		DECLARE v_param_code varchar(2000);
    DECLARE done INT DEFAULT FALSE;
    DECLARE cur_sm_organ CURSOR FOR select code,name from sm_organ where code not in ('000001','999999');
		DECLARE cur_ams_param CURSOR FOR select param_code from ams_param where PARAM_SPECIES_CODE ='VAL_PERIOD';
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
		delete from ams_box;
		delete from ams_code where type ='dahcode';
    OPEN  cur_sm_organ;  
		out_loop:LOOP
			FETCH cur_sm_organ INTO v_code,v_name;

			IF done = 1 THEN
            LEAVE out_loop;
      END IF;

			OPEN  cur_ams_param;  
			inner_loop:LOOP
				FETCH cur_ams_param INTO v_param_code;
				IF done = 1 THEN
          LEAVE inner_loop;
        END IF;

				set n = 1;
				WHILE n <= 50 DO
					set v_id = CONCAT('2018','-',v_code,'-',v_param_code,'-',right(100000+n,5));

					set v_id999999 = CONCAT('2018-999999-',v_code,'-',v_param_code,'-',right(100000+n,5));

					set v_id000001 = CONCAT('2018-000001-',v_code,'-',v_param_code,'-',right(100000+n,5));
					
					set n = n + 1;
				END WHILE;
				

			end LOOP inner_loop;
			CLOSE cur_ams_param;

			SET done=0;

		END LOOP out_loop;
    CLOSE cur_sm_organ;
END
;;
DELIMITER ;
